import React from 'react'

const magicList = (props)=>{

	const cardsList = props.magicCards.map((magicCards, i)=>{
		return <li key={i} className="three wide column">{magicCards.name}, ({magicCards.set}), {magicCards.rarity}<img src={magicCards.image_uris.large} alt='magic cards' className='enlarge ui fluid image'/></li>
	})
	return(
		<div>
		<div className="floatLeft">
			<ul className = "ui grid">
				{cardsList}
			</ul>
		</div>
		<div className="floatRight">
			Wombo
		</div>
		</div>
	)
}

export default magicList
